INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (1, "リン", "あたしだって\nやるときはやるよ！", 0.0, 0.0, 10040, "2020/04/30 12:00:00", 24001, 0, 24, 1, "2030/12/17 14:59:59", 0.0, 102601);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (1, "リン", "ふぅ…\nこれであたしの仕事は\n終わりだね", 0.0, 0.0, 10040, "2020/04/30 12:00:00", 24002, 1, 24, 1, "2030/12/17 14:59:59", 0.0, 102601);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (1, "リン", "終わった終わった\n一人でもなんとか\nなるもんだね", 0.0, 0.0, 10040, "2020/04/30 12:00:00", 24003, 2, 24, 1, "2030/12/17 14:59:59", 0.0, 102601);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (2, "リン", "やったね！\nこれでようやく\nサボれるよ…", 0.0, 0.0, 10040, "2020/04/30 12:00:00", 24004, 3, 24, 2, "2030/12/17 14:59:59", 0.0, 102601);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (1, "リン", "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 0.0, 0.0, 10040, "2020/04/30 12:00:00", 24005, 4, 24, 1, "2030/12/17 14:59:59", 0.0, 102601);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (2, "リン", "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 0.0, 0.0, 10040, "2020/04/30 12:00:00", 24006, 5, 24, 2, "2030/12/17 14:59:59", 0.0, 102601);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (2, "リン", "あたしも意外と\nやるもんでしょ？", 0.0, 0.0, 10040, "2020/04/30 12:00:00", 24007, 6, 24, 2, "2030/12/17 14:59:59", 0.0, 102601);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (4, "リン", "疲れた…\nねずみの逃げ足\n速すぎるよ…", 0.0, 0.0, 10040, "2020/04/30 12:00:00", 24008, 7, 24, 4, "2030/12/17 14:59:59", 0.0, 102601);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (4, "リン", "このままじゃ\nまっひ～に\n叱られちゃうよ", 0.0, 0.0, 10040, "2020/04/30 12:00:00", 24009, 8, 24, 4, "2030/12/17 14:59:59", 0.0, 102601);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (4, "リン", "まじめに\nやったんだけどな…\n悔しいな～", 0.0, 0.0, 10040, "2020/04/30 12:00:00", 24010, 9, 24, 4, "2030/12/17 14:59:59", 0.0, 102601);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (4, "リン", "やられた…\nねずみって意外と\nてごわいね", 0.0, 0.0, 10040, "2020/04/30 12:00:00", 24011, 10, 24, 4, "2030/12/17 14:59:59", 0.0, 102601);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (4, "リン", "おのれ～\nあたしのチーズを\n盗みやがって～！", 0.0, 0.0, 10040, "2020/04/30 12:00:00", 24012, 11, 24, 4, "2030/12/17 14:59:59", 0.0, 102601);
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES (4, "リン", "疲れた…\nけど、次こそは\n守り抜くよ…", 0.0, 0.0, 10040, "2020/04/30 12:00:00", 24013, 12, 24, 1, "2030/12/17 14:59:59", 1.81, 102601);
